        let input = document.getElementById('userInput').value;
        let filter, tr, td, i, txtValue;

       filter = input.toUpperCase();
        tr = table.getElementsByTagName(""tr"");

        //loop through table
        for (i = 0; i < tr.length; i++) {
            td = tr[i].getElementsByTagName(""td"")[0];
            if (td) {
